import React, { Component } from "react"
import { makeGetRequest } from "../../api_calls"

class EnterInstagram extends Component {
    constructor(props) {
        this.state = {
            code: null
        }
    }

    generateCode = () => {
        makeGetRequest('business/generateCode',
            (code) => {
                console.log(code)
                this.setState({code})
            }
        )
    }

    render() {
        return (
            <div className="panel">
                <div style={{backgroundColor: 'white'}}>{this.state.code}</div>
                <button onClick={this.generateCode}>Click to generate</button>
            </div>
        )
    }
}

export default EnterInstagram
